import React, { Component } from 'react'
import { Link} from 'react-router-dom'

class Nav extends Component {


  renderNavLinks = () => {
    if(localStorage.token !== "undefined" || localStorage.length > 0 ){
      return  <>
              <Link to="/">Home</Link>
              <Link to="/profile">Profile</Link>
              </>
    }  else {
      return <>
             <Link to="/">Home</Link>
             <Link to="/login">Login</Link>
             </>
          }
  }

 render() {
  return(

   <nav>
     {this.renderNavLinks()}
   </nav>

    )
   }
 }



export default Nav
